import React from 'react';
import { useLocation } from 'react-router-dom';

function ActiveAPIs() {
  const location = useLocation();
  const apis = location.state?.apis || [];

  return (
    <div>
      <h1>Active APIs</h1>
      <ul>
        {apis.map((api, index) => (
          <li key={index}>{api}</li>
        ))}
      </ul>
    </div>
  );
}

export default ActiveAPIs;
